    "step1_help2": {                                 "en": "or <b><i>\"Next\"</i></b> to use devices from previous discovery process", "de": "oder <b><i>\"Weiter\"</i></b> um die Geräte der vorherigen Suche zu benützen", "ru": "или <b><i>\"Дальше\"</i></b> что бы использовать устройства из предудущего поиска", "pt": "ou <b> <i> \"Próximo\" </i> </b> para usar dispositivos do processo de descoberta anterior", "nl": "of <b> <i> \"Volgende\" </i> </b> om apparaten van het vorige ontdekkingsproces te gebruiken", "fr": "ou <b> <i> \"Suivant\" </i> </b> pour utiliser les périphériques du processus de découverte précédent", "it": "oppure <b> <i> \"Avanti\" </i> </b> per utilizzare i dispositivi del processo di scoperta precedente", "es": "o <b> <i> \"Siguiente\" </i> </b> para usar dispositivos del proceso de descubrimiento previo", "pl": "lub <b> <i> \"Dalej\" </i> </b>, aby używać urządzeń z poprzedniego procesu wykrywania"},
